webpackJsonp([0x5f7d49d1226e],{456:function(p,n){p.exports={data:{markdownRemark:{html:'<h1>pip</h1>\n<p>pip - устанавливает пакеты для python2</p>\n<p>Если нужно для третьего, то понадобится pip3</p>\n<pre><code>apt-get install python3-pip\n</code></pre>\n<h2>Установка конкретной версии пакета</h2>\n<pre><code>pip install PyQt5==5.5\n</code></pre>\n<p>Если нужно указывать диапазон версий, то нужно заключить пакет в кавычки:</p>\n<pre><code>pip install "package>=0.2,&#x3C;0.3"\n</code></pre>\n<h2>Установка pip без интернета:</h2>\n<pre><code class="language-shell">python pip-6.0.6-py2.py3-none-any.whl/pip install --no-index pip-6.0.6-py2.py3-none-any.whl\n</code></pre>\n<p>.whl можно взять здесь: <a href="https://pypi.python.org/simple/pip/">https://pypi.python.org/simple/pip/</a></p>',frontmatter:{path:"/blog/pip",title:"pip"}}},pathContext:{}}}});
